import React from 'react';
import { Cards } from './Cards';
import { Data } from './Array_data';

function App1() {
    
    return (<>

        <Cards
            imgsrc={Data[0].imgsrc}
            title={Data[0].title}
            sname={Data[0].sname}
            link={Data[0].link} />
        <Cards
            imgsrc={Data[1].imgsrc}
            title={Data[1].title}
            sname={Data[1].sname}
            link={Data[1].link} />
        
        <Cards
            imgsrc={Data[2].imgsrc}
            title={Data[2].title}
            sname={Data[2].sname}
            link={Data[2].link} />


    </>);
}

export { App1 };
